//MyPageMenu.tsx
import React from 'react';
import { Link, NavLink } from 'react-router-dom';
// import * as S from './style';

export const Mypage = () => {

  return (
    <div>
      
           <div >
            마이페이지
          </div>

        <ul>

          <li>
            <Link to="/mypage" variant="body2">
                  회원 정보
                </Link>
          </li>

          <div>
            이름 : 옆에 박스 텍스트 박스로 이름 보여주기
          </div>
          
          <div>
            아이디 : 옆에 박스 텍스트 박스로 아이디 보여주기
          </div>

          <div>
            비밀번호 : 아이디 옆에 박스 텍스트 박스로 아이디 보여주기, 변경칸 추가
          </div>



        </ul>

      


      
    </div>
  )};
  
  export default Mypage;
